import React, {  useState } from "react";
import data from "../../mock-data.json";
import "./Todos.css"

const Todos = () => {
	return (
		<>
			<form className="form" autoComplete="off">
				<input 
					type="text"
					placeholder="Enter a name..."
					name="fullName"
					required
				/>
				<input 
					type="text"
					placeholder="Enter an address"
					
				/>
			</form>
		</>
	)
};

export default Todos;
